CREATE TABLE cap_file_node (
sbm_id SERIAL PRIMARY KEY, 
submitter_name character varying(128) DEFAULT ''::character varying NOT NULL, 
name character varying(32) DEFAULT ''::character varying NOT NULL, 
name_email character varying(32) DEFAULT ''::character varying NOT NULL, 
uid INTEGER NOT NULL CHECK (uid>= 0) DEFAULT 0, 
ip VARCHAR(32) NOT NULL, 
species_version VARCHAR(32) NOT NULL, 
file_name VARCHAR(128) NOT NULL, 
file_type VARCHAR(32) NOT NULL, 
file_md5 VARCHAR(32) NOT NULL, 
file_size INTEGER NOT NULL, 
file_desc VARCHAR(1256) NOT NULL DEFAULT '',
timestamp timestamp without time zone,
CONSTRAINT node_sbm_check CHECK ((sbm_id >= 0)),
CONSTRAINT files_size_check CHECK ((file_size >= 0))
);

